import React from 'react';
import './CloudCards.css'

const CloudCards = (props) => {
  return (
    <div className="CloudCards">
    <nav>
    <ul className = "Clouds">
  <p>AWS</p>
  <p>Azure</p>
  <p>This is a {props.me} from the 2nd component.
  Explore more than 60 products and start building on AWS using the free tier.
  Three different types of free offers are available depending on the product used.
  See below for details on each product.</p>
  </ul>
  </nav>
  </div>
)
}



export default CloudCards;
